import React from 'react'
import './Login.css'
import { Form, Input, Button, Checkbox } from 'antd';
import { Link } from 'react-router-dom';

function Login() {
    return (
        <div className="main-login">
            로그인 페이지 <br />
            <Link to='register'>회원가입</Link>
            <div className="login-contain">
                <div className="left-side">
                    <div className="form">
                        <Form
                            name="basic"
                            labelCol={{
                                span: 8,
                            }}
                            wrapperCol={{
                                span: 16,
                            }}
                            initialValues={{
                                remember: false,
                            }}
                            autoComplete="off"
                        >
                            <Form.Item
                                label="아이디"
                                name="id"
                                rules={[
                                    {
                                        required: true,
                                        message: '아이디를 입력해주세요!',
                                    },
                                ]}
                            >
                                <Input placeholder="입력해주세요"/>
                            </Form.Item>

                            <Form.Item
                                label="비밀번호"
                                name="password"
                                rules={[
                                    {
                                        required: true,
                                        message: '비밀번호를 입력해주세요!',
                                    },
                                ]}
                            >
                                <Input.Password placeholder="입력해주세요" />
                            </Form.Item>

                            <Form.Item
                                wrapperCol={{
                                    offset: 8,
                                    span: 16,
                                }}
                            >
                                <Button type="primary" htmlType="submit">
                                    로그인
                                </Button>
                            </Form.Item>

                            <Form.Item
                                name="remember"
                                valuePropName="checked"
                                wrapperCol={{
                                    offset: 8,
                                    span: 16,
                                }}
                            >
                                <Checkbox>로그인 유지</Checkbox>
                            </Form.Item>

                        </Form>
                    </div>
                </div>
                <div className="right-side">

                </div>

            </div>

        </div>
    )
}

export default Login


